Unit test structure
The contents of every unit test should be split into three distinct stages, optionally
separated by these comments:
The crucial thing here is the Act stage is exactly one statement. That one statement is
nothing more than a call to the one method that you are trying to test. keeping that one
statement as simple as possible is also very important. For example, this is not ideal:
This style is not recomended because way too many things can go wrong in this one
statement. All the GetComplexParamN() calls can throw for a variety of reasons unrelated to
the test itself. It is thus unclear to someone running into a problem why the failure occured.
The ideal pattern is to move the complex parameter building into the `Arrange section:
Now the only reason the line with CallSomeMethod() can fail is if the method itself blew up.
