Parallel tests
By default all unit test assemblies should run in parallel mode, which is the default. Unit
tests shouldn't depend on any shared state, and so should generally be runnable in
parallel. If the tests fail in parallel, the first thing to do is to figure out why; do not just
disable parallel tests!
